const lz4js = require('lz4js');

class CompressionUtil {
  static compressString = async (inputString) => {
    try {
      const inputBuffer = Buffer.from(inputString, 'utf-8');
      const compressedBuffer = lz4js.compress(inputBuffer);

      const startTime = process.hrtime.bigint();
      const endTime = process.hrtime.bigint();

      const timeTaken = (endTime - startTime) / 1000n; // Convert to microseconds
      console.log(`Compression time: ${timeTaken} microseconds`);

      return compressedBuffer;
    } catch (error) {
      console.error('Compression error:', error);
      throw error;
    }
  };

  static decompressString = async (compressedBuffer) => {
    try {
      const startTime = process.hrtime.bigint();
      const decompressedBuffer = lz4js.decompress(compressedBuffer);
      const endTime = process.hrtime.bigint();

      const timeTaken = (endTime - startTime) / 1000n; // Convert to microseconds
      console.log(`Decompression time: ${timeTaken} microseconds`);

      return decompressedBuffer.toString('utf-8');
    } catch (error) {
      console.error('Decompression error:', error);
      throw error;
    }
  };
}



